import React from 'react';
import './ImageLinkFrom.css'


const ImageLinkFrom = () => {
	return (
		<div>
		  <p className="f4">This Website will detect faces in your picture</p>
		  <div className='center'>
		    <div className='from center pa4 br2 shadow-5'>
		      <input type='text' className='f4 w-70 pa2' placeholder='Url'/>
		      <button className='f4 w-30 grow ph4 pv2 bg-light-blue'>Detect</button>
		    </div>
		  </div>
		</div>
	)
}

export default ImageLinkFrom;
